import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./styles.css";
import NAV from "./NAV";
import About from "./About.js"


export default function App() {
  return (
    <div className="App">
      <Router>
        <NAV />
        <Routes>
          <Route index element={<About />} />
          {/* <Route path="/Games" element={<Games />} /> */}
        </Routes>
      </Router>
    </div>
  );
}
